import React from 'react';
import '../style/post.css';
export default function Post() {
  return (
    <div className='post'>
         <img className='postImg' src="https://forkast.news/wp-content/uploads/2023/03/Bitcoin-3-1260x840.jpg" alt="" />
         <div className="postInfo">
         <span className="postAbout">Crypto</span>
         <span className="postTitle">Lorem ipsum dolor sit amet consectetur adipisicing elit. </span>
         <span className="postTime">30 min ago</span>
         </div>
         <p className="postDescription"></p>
    </div>
  )
}
